selector_to_html = {"a[href=\"#light-beads-microscopy-data\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h1><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>", "a[href=\"#\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Light Beads Microscopy Data<a class=\"headerlink\" href=\"#light-beads-microscopy-data\" title=\"Permalink to this heading\">#</a></h1><p>Current Light Beads Microscopy (LBM) data is aquired with ScanImage aquisition software.</p><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">Multi Region Of Interest (mROI)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.</p>", "a[href=\"#term-num_pixel_xy\"]": "<dt id=\"term-num_pixel_xy\">num_pixel_xy</dt><dd><p>The number of pixels [X, Y] in each <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a>.</p></dd>", "a[href=\"#understanding-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Understanding Metadata<a class=\"headerlink\" href=\"#understanding-metadata\" title=\"Permalink to this heading\">#</a></h2><p id=\"scanimage-metadata\">ScanImage stores metadata about image size, frame rate, resolution, and regions of interest within the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file. Each pipeline handles this metadata for you, and provides an interface to use these values throughout the pipeline.</p><p>There is primary metadata, intended for use in a typical processing run. Many of these values are derived from less-pertinent (secondary) metadata.</p>", "a[href=\"../ref.html#multipage-tiff\"]": "<figure class=\"align-default\" id=\"multipage-tiff\">\n<img alt=\"Multipage Tiff\" src=\"../_images/gen_array_page.gif\"/>\n<figcaption>\n<p><span class=\"caption-text\">MultiPage Tiff</span><a class=\"headerlink\" href=\"#multipage-tiff\" title=\"Permalink to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#term-roi_width_px\"]": "<dt id=\"term-roi_width_px\">roi_width_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its shortest dimension.</p></dd>", "a[href=\"#term-pixel-resolution\"]": "<dt id=\"term-pixel-resolution\">pixel-resolution</dt><dd><p>The size, in micron, of each pixel.</p></dd>", "a[href=\"#term-image-length\"]": "<dt id=\"term-image-length\">image-length</dt><dd><p>The number of pixels on the long axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>", "a[href=\"#term-roi_height_px\"]": "<dt id=\"term-roi_height_px\">roi_height_px</dt><dd><p>The size of the <a class=\"reference internal\" href=\"#term-region-of-interest\"><span class=\"xref std std-term\">region-of-interest</span></a> on its longest dimension.</p></dd>", "a[href=\"#term-region-of-interest\"]": "<dt id=\"term-region-of-interest\">region-of-interest</dt><dd><p>A set of 1 or more 2D planes which are stitched together to form the full image.</p></dd>", "a[href=\"#term-Field-of-view\"]": "<dt id=\"term-Field-of-view\">Field-of-view</dt><dd><p>The total size (um) of the raw stitched image with no trimming operations.</p></dd>", "a[href=\"#using-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.2. </span>Using Metadata<a class=\"headerlink\" href=\"#using-metadata\" title=\"Permalink to this heading\">#</a></h2><p>Each pipeline comes stocked with methods to retrieve imaging metadata.</p>", "a[href=\"#term-image-width\"]": "<dt id=\"term-image-width\">image-width</dt><dd><p>The number of pixels on the short, slow-galvo axis of the raw <code class=\"code docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> file.</p></dd>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
